  useEffect(() => {
    fetchUser(props.match.params.id)
      .then((data) =>
        console.log(data)
      )
  }, [])

  return (
    <Fragment>
      ユーザーページ
      <p>UserIdは{props.match.params.id}です</p>
      <p>{data}</p>
    </Fragment>
  )
}
